import React from 'react';

function TacticDisplay({ tactics }) {
    return (
        <pre>
            {tactics.length === 0 ? "The pgn file will be generated here, copy the content and save it as pgn." : tactics.map((t, index) => <div key={index}>{t}</div>)}
        </pre>
    );
}

export default TacticDisplay;
